  MMU_GEAR_UART=PG8,
  MMU_GEAR_STEP=PG7,
  MMU_GEAR_DIR=PG6,
  MMU_GEAR_ENABLE=PC7,
  MMU_GEAR_DIAG=PC6,
  MMU_SEL_UART=PD11,
