[stepper_x]
step_pin: PF15
dir_pin: PF14
enable_pin: !PE9
microsteps: 64
rotation_distance: 40
endstop_pin: ^toolhead:gpio24 #tmc2209_stepper_x:virtual_endstop 
position_endstop: 256
position_max: 256
position_min: -12
homing_speed: 100
homing_retract_dist: 0

[tmc5160 stepper_x]
cs_pin: PE11
spi_bus: spi4
sense_resistor: 0.075
interpolate: false
run_current: 1.2

[stepper_y]
step_pin: PB10
dir_pin: PB11
enable_pin: !PG0
microsteps: 64
rotation_distance: 40
endstop_pin: ^PC2 #tmc2209_stepper_y:virtual_endstop
position_min: -7
position_endstop: -6
position_max: 264
homing_speed: 100
homing_retract_dist: 0

[tmc5160 stepper_y]
cs_pin: PE15
spi_bus: spi4
sense_resistor: 0.075
interpolate: false
run_current: 1.2

[stepper_z]
