dir_pin: PD3
enable_pin: !PD7
microsteps: 64
rotation_distance: 4
endstop_pin: probe:z_virtual_endstop
#position_endstop: 0
position_max: 300
position_min: -10
homing_speed: 8
#second_homing_speed: 8
#homing_retract_speed: 30
homing_retract_dist: 0

[tmc2209 stepper_z]
interpolate: false
uart_pin: PD5
run_current: 1.0

[stepper_z1]
